import React, { useState, useEffect } from "react";
import API from "../../API/api";

export default function CPA() {
  const [employees, setEmployees] = useState([]);
  const [dates, setDates] = useState([]);
  const [scheduleData, setScheduleData] = useState({});

  useEffect(() => {
    const fetchEmployees = async () => {
      try {
        const token = localStorage.getItem("token");
        const res = await API.get("/employee/employeeList", {
          headers: { Authorization: `Bearer ${token}` },
        });
        setEmployees(res.data);
      } catch (err) {
        console.error(err);
      }
    };
    fetchEmployees();
  }, []);

  const generateDateRange = (start, end) => {
    const result = [];
    let current = new Date(start);
    const endDate = new Date(end);
    while (current <= endDate) {
      result.push(new Date(current));
      current.setDate(current.getDate() + 1);
    }
    return result;
  };

  const handleDateRangeChange = (start, end) => {
    const range = generateDateRange(start, end);
    setDates(range);
  };

  useEffect(() => {
    handleDateRangeChange("2025-08-18", "2025-08-22"); // 예시 날짜
  }, []);

  return (
    <div className="p-6 max-w-full overflow-auto">
      <h2 className="text-3xl font-bold mb-6 text-center">CPA Report</h2>
      <table className="min-w-full border border-gray-300">
        <thead>
          <tr>
            <th rowSpan={3} className="border px-2 py-1 bg-gray-200">
              Name
            </th>
            <th rowSpan={3} className="border px-2 py-1 bg-gray-200">
              Hourly Pay
            </th>
            {dates.map((date) => (
              <th
                key={date}
                colSpan={4}
                className="border px-2 py-1 bg-gray-100"
              >
                {date.getMonth() + 1}/{date.getDate()}
              </th>
            ))}
          </tr>
          <tr>
            {dates.map((date) => (
              <React.Fragment key={date}>
                <th colSpan={2} className="border px-2 py-1 bg-gray-50">
                  AM
                </th>
                <th colSpan={2} className="border px-2 py-1 bg-gray-50">
                  PM
                </th>
              </React.Fragment>
            ))}
          </tr>
          <tr>
            {dates.map((date) => (
              <React.Fragment key={date}>
                <th className="border px-2 py-1 bg-gray-50">Hourly</th>
                <th className="border px-2 py-1 bg-gray-50">Tip</th>
                <th className="border px-2 py-1 bg-gray-50">Hourly</th>
                <th className="border px-2 py-1 bg-gray-50">Tip</th>
              </React.Fragment>
            ))}
          </tr>
        </thead>
        <tbody>
          {employees.map((emp) => (
            <tr key={emp._id}>
              <td className="border px-2 py-1">{emp.name}</td>
              <td className="border px-2 py-1">${emp.hourlyPay}</td>
              {dates.map((date) => {
                const key = `${date.getMonth() + 1}/${date.getDate()}`;
                const dayData = scheduleData[emp._id]?.[key] || {};
                const AM = dayData.AM || { hourly: 0, tip: 0 };
                const PM = dayData.PM || { hourly: 0, tip: 0 };
                return (
                  <React.Fragment key={key}>
                    <td className="border px-2 py-1">{AM.hourly}</td>
                    <td className="border px-2 py-1">{AM.tip}</td>
                    <td className="border px-2 py-1">{PM.hourly}</td>
                    <td className="border px-2 py-1">{PM.tip}</td>
                  </React.Fragment>
                );
              })}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
